import { Component } from '@angular/core';
import { HttpClient } from "@angular/common/http";

@Component({
  selector: 'app-ranking-simulado',
  templateUrl: './ranking-simulado.component.html',
  styleUrls: ['./ranking-simulado.component.css']
})
export class RankingSimuladoComponent {

  usuariosReq
  usuarios:any

  constructor(private http: HttpClient) {
    this.usuariosReq = http.get('http://localhost:8080/respostasUsuarios/rankingSimulado/1')
    this.usuariosReq.subscribe(dados => this.usuarios = dados)
  }

}
